// Marbles.js
import React from 'react';

const marbleImages = [
    {
      image: 'sunnywhite.jpg',
      title: 'Sunny White',
    },

    {
      image: 'sunnygrey.jpg',
      title: 'Sunny Grey',
    },

    {
      image: 'indiangreen.jpg',
      title: 'Indian Green',
    },
    {
      image: 'badal.jpg',
      title: 'Badal',
    },
    {
      image: 'blackandgold.jpg',
      title: 'Black and Gold',
    },
    {
      image: 'chinaverona.jpg',
      title: 'China Verona',
    },
  ];



function Marbles() {
  return (
    <div className="left-container">
      <div className="row">
        {marbleImages.slice(0, 3).map((product, index) => (
          <div key={index} className="col-md-4 mb-5">
            <img src={product.image} alt={product.title} className="stone-img" />
            <h5>{product.title}</h5>
          </div>
        ))}
      </div>
      <div className="row">
        {marbleImages.slice(3, 6).map((product, index) => (
          <div key={index} className="col-md-4 mb-5">
            <img src={product.image} alt={product.title} className="stone-img" />
            <h5>{product.title}</h5>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Marbles;
